import{_ as a,c as t,o as i,ag as o}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"DROP MATERIALIZED VIEW","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_MATERIALIZED_VIEW.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_MATERIALIZED_VIEW.md"}'),s={name:"docs/7x/ref_guide/sql_commands/DROP_MATERIALIZED_VIEW.md"};function r(d,e,n,l,c,p){return i(),t("div",null,e[0]||(e[0]=[o('<h1 id="drop-materialized-view" tabindex="-1">DROP MATERIALIZED VIEW <a class="header-anchor" href="#drop-materialized-view" aria-label="Permalink to &quot;DROP MATERIALIZED VIEW&quot;">​</a></h1><p>Removes a materialized view.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP MATERIALIZED VIEW [ IF EXISTS ] &lt;name&gt; [, ...] [ CASCADE | RESTRICT ]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP MATERIALIZED VIEW</code> drops an existing materialized view. To run this command, you must be the owner of the materialized view.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the materialized view does not exist. A notice is issued in this case.</p><p>name : The name (optionally schema-qualified) of a materialized view to be dropped.</p><p>CASCADE : Automatically drop objects that depend on the materialized view (such as other materialized views, or regular views), and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the materialized view if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>This command removes the materialized view called <code>order_summary</code>.</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP MATERIALIZED VIEW order_summary;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>DROP MATERIALIZED VIEW</code> is a WarehousePG extension of the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_MATERIALIZED_VIEW.html">ALTER MATERIALIZED VIEW</a>, <a href="./CREATE_MATERIALIZED_VIEW.html">CREATE MATERIALIZED VIEW</a>, <a href="./REFRESH_MATERIALIZED_VIEW.html">REFRESH MATERIALIZED VIEW</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',19)]))}const E=a(s,[["render",r]]);export{m as __pageData,E as default};
